// Cart Items Styled Component
import styled from 'styled-components';

export const CartItemContainer = styled.div`
    width: 100%;
    display: flex;
    height: 80px;
    margin-bottom: 15px;
`;

export const CartItemImage = styled.img`
    width: 30%;
`;
